import React, {useEffect, useState} from 'react'

const Fetch = () => {

    const [backendData, setBackendData] = useState([{}])

    useEffect(() => {
        fetch("/api").then(
          response => response.json()
        ).then(
          data => {
            setBackendData(data)
          }
        )
      }, [])

    return (
        <div>
            {(typeof backendData === 'undefined' && backendData != null) ? (
                <p>Loading...</p>
            ): (
                backendData.map(x => (
                    <p id={x.id}>{x.name}</p>
                ))
            )}
        </div>
    )
}

export default Fetch
